import React, {useState} from "react";
import "./LoginAttemptList.css";

const LoginAttempt = (props) => <li {...props}>{props.children}</li>;

const LoginAttemptList = (props) => {
	const [filter, setFilter] = useState("");


	const updateFilter = (event) => {
		const _filter = event.target.value;
		setFilter({ ...filter, _filter })
	}

	const renderList = (attempts) => {
		return attempts
		.filter(attempt => 
			{
			
				if (filter)
			{
				return attempt.login.includes(filter) || attempt.password.includes(filter)
			}
			return attempt;
		})
		//.map((attempt, index) => { return <LoginAttempt key={index}><span>{attempt.login}</span> {attempt.password}</LoginAttempt>})

		.map((attempt, index) => { 
			return (
			<li key={index}>
				<LoginAttempt><span>{attempt.login}</span> {attempt.password}</LoginAttempt> 
			</li> )
		}) 
    
	  };

		 return (
			
		 	<div className="Attempt-List-Main">
		 		<p>Recent activity</p>
		 		<input type="input" placeholder="Filter..." value={filter} onChange={updateFilter} />
		 		<ul className="Attempt-List">
				 {renderList(props.attempts)}
		 		</ul>
		 	</div>
		 	);	
}


export default LoginAttemptList;
